script: |
  super -f text -I q12610.spq | sort > q12610.out

inputs:
  - name: q12610.spq
    data: |
      SELECT col0 AS col2 FROM tab2 (FORMAT parquet) AS cor0 WHERE NOT - col2 / CAST ( NULL AS INTEGER ) NOT BETWEEN NULL AND 35 / col2 + - 82;
  - name: tab2

outputs:
  - name: q12610.out
    data: |
